  import React from 'react';
  import AntTabs from '@material-ui/core/AntTabs';
  import { List,Title } from '@material-ui/core';
export default function Notification(){
    return (
        <React.Fragment>
      <Title>Thông báo</Title>
      <List component="nav"aria-label="contacts">
  <ListItem button>
    <ListItemIcon>
      <StarIcon />
    </ListItemIcon>
    <ListItemText primary="Chelsea Otakan" />
  </ListItem>
  <ListItem button>
    <ListItemText inset primary="Eric Hoffman" />
  </ListItem>
</List>
    </React.Fragment>
    )
}
